pragma solidity ^0.4.18;

import './ERC20.sol';

contract CTNToken is ERC20 {

    string public constant SYMBOL = "CTN";
    string public constant NAME = "CTN Token";
    uint8 public constant DECIMALS = 18;
    uint256 _totalSupply = 30000000;

    // Owner of this contract
    address public owner;

    // Balances for each account
    mapping(address => uint256) balances;
   
    // Owner of account approves the transfer of an amount to another account
    mapping(address => mapping (address => uint256)) allowed;

    // Functions with this modifier can only be executed by the owner
    modifier onlyOwner() {
        if (msg.sender != owner) {
            revert();
        }
        _;
    }

    //Initializing the token with the owner and the amount of coins
    function CTNToken() public {
          owner = msg.sender;owner = msg.sender;
          balances[owner] = _totalSupply;
    }

    //To get the total supply of ctn coins 
    function totalSupply() public constant  returns (uint256 totalAmount) {
          totalAmount = _totalSupply;
    }

    //Returns the balance of the wallet (owner)
    function balanceOf(address _owner) public constant returns (uint balance) {
        return balances[_owner];
    }


    function transfer(address _to, uint _amount) public returns (bool success) {
         if (balances[msg.sender] >= _amount && _amount > 0 && balances[_to] + _amount > balances[_to]) {
             balances[msg.sender] -= _amount;
             balances[_to] += _amount;
             Transfer(msg.sender, _to, _amount);
             return true;
         } else {
             return false;
         }
    }
    // Send _amount of tokens from address _from to address _to
      // The transferFrom method is used for a withdraw workflow, allowing contracts to send
      // tokens on your behalf, for example to "deposit" to a contract address and/or to charge
      // fees in sub-currencies; the command should fail unless the _from account has
      // deliberately authorized the sender of the message via some mechanism; we propose
      // these standardized APIs for approval:
      function transferFrom(
          address _from,
          address _to,
          uint256 _amount
     ) public returns (bool success) 
     {
         if (balances[_from] >= _amount && allowed[_from][msg.sender] >= _amount && _amount > 0 && balances[_to] + _amount > balances[_to]) {
             balances[_from] -= _amount;
             allowed[_from][msg.sender] -= _amount;
             balances[_to] += _amount;
             Transfer(_from, _to, _amount);
             return true;
         } else {
             return false;
         }
     }

    /**
   * @dev Approve the passed address to spend the specified amount of tokens on behalf of msg.sender.
   *
   * Beware that changing an allowance with this method brings the risk that someone may use both the old
   * and the new allowance by unfortunate transaction ordering. One possible solution to mitigate this
   * race condition is to first reduce the spender's allowance to 0 and set the desired value afterwards:
   * https://github.com/ethereum/EIPs/issues/20#issuecomment-263524729
   * @param _spender The address which will spend the funds.
   * @param _amount The amount of tokens to be spent.
   */
    function approve(address _spender, uint _amount) public returns (bool success) {
        allowed[msg.sender][_spender] = _amount;
        Approval(msg.sender, _spender, _amount);
        return true;
    }

    function allowance(address _owner, address _spender) public constant returns (uint256 remaining) {
         return allowed[_owner][_spender];
    }

 }
